import React from "react";
import './Page2.css';

function Page2() {
  return (
    <div className="Page2">
      <div>
        <h1 className="headpage2">Change the way you build websites Forever.</h1>
        <p>In case you are starting a business or launching any product in the market, Using the availbale pages you can quickly get started in a day with your website. The desgin quality is polished very well, it looks very professional.</p>
      </div>
    </div>
  );
}

export default Page2;
